INSERT INTO `wp_posts` VALUES (1,1,'2018-04-03 14:25:29','2018-04-03 14:25:29','Welcome to WordPress. This is your first post. Edit or delete it, then start writing!','Hello world!','','publish','open','open','','hello-world','','','2018-04-03 14:25:29','2018-04-03 14:25:29','',0,'http://165.227.29.172/?p=1',0,'post','',0),(2,1,'2018-04-03 14:25:29','2018-04-03 14:25:29','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://165.227.29.172/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','publish','closed','open','','sample-page','','','2018-04-03 14:25:29','2018-04-03 14:25:29','',0,'http://165.227.29.172/?page_id=2',0,'page','',0),(4,1,'2016-12-30 07:54:06','2016-12-30 07:54:06','<label> Your Name (required)\r\n    [text* your-name] </label>\r\n\r\n<label> Your Email (required)\r\n    [email* your-email] </label>\r\n\r\n<label> Subject\r\n    [text your-subject] </label>\r\n\r\n<label> Your Message\r\n    [textarea your-message] </label>\r\n[recaptcha]\nLabora \"[your-subject]\"\n[your-name] <wpdemo@bannersmonster.com>\nFrom: [your-name] <[your-email]>\r\nSubject: [your-subject]\r\n\r\nMessage Body:\r\n[your-