onmental, and genetic factors which impact long-term health. You are unique and the approach to bringing your system back into balance is unique to you. Your functional medicine prescription is very different from anyone elses.[/vc_column_text][/vc_column][/vc_row][vc_row css=\".vc_custom_1478067224474{padding-top: 50px !important;padding-bottom: 30px !important;}\"][vc_column][vc_column_text css=\".vc_custom_1476769183350{padding-bottom: 30px !important;}\"]\n<h1 class=\"aligncenter\">A personalized strategy for each of your life goals.[/vc_column_text][vc_row_inner][vc_column_inner width=\"1/3\"][labora_vc_charts chart_data=\"circle\" legend=\"yes\" xy_circle=\"%5B%7B%22title%22%3A%22Health%20Care%22%2C%22value%22%3A%2265%22%2C%22colors%22%3A%22%234a525d%22%7D%2C%7B%22title%22%3A%22Diabetes%22%2C%22value%22%3A%2225%22%2C%22colors%22%3A%22%23990b6e%22%7D%5D\" height=\"170\" width=\"170\" extra_class=\"aligncenter\" css=\".vc_custom_1478067793029{padding-bottom: 20px !important;}\"][vc_column_text el_class=\"aligncenter\"]</h1>\n<h3>Diabetes</h3>\nFusce est leo, dapibus non pellentesque sed, scelerisque nec sapien. In accumsan efficitur gravida. Nam eget neque quis nisi pulvinar molestie.[/vc_column_text][/vc_column_inner][vc_column_inner width=\"1/3\"][labora_vc_charts chart_data=\"circle\" legend=\"yes\" xy_circle=\"%5B%7B%22title%22%3A%22Health%20Care%22%2C%22value%22%3A%2250%22%2C%22colors%22%3A%22%234a525d%22%7D%2C%7B%22title%22%3A%22Heart%20Disease%22%2C%22value%22%3A%2250%22%2C%22colors%22%3A%22%23990b6e%22%7D%5D\" height=\"170\" width=\"170\" extra_class=\"aligncenter\" css=\".vc_custom_1478067825036{padding-bottom: 20px !important;}\"][vc_column_text el_class=\"aligncenter\"]\n<h3>Heart Disease</h3>\nFusce est leo, dapibus non pellentesque sed, scelerisque nec sapien. In accumsan efficitur gravida. Nam eget neque quis nisi pulvinar molestie.[/vc_column_text][/vc_column_inner][vc_column_inner width=\"1/3\"][labora_vc_charts chart_data=\"circle\" legend=\"yes